    public FMSApplicationUserVM ApplicationUser = new FMSApplicationUserVM();

    public List<GBMSUserVM> UsersList { get; set; }

    public List<GBMSUserVM> FilteredUsersList { get; set; }

    public List<FMSRoleVM> RolesList { get; set; }

